import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [dates, setDates] = useState([]);
  const [newDate, setNewDate] = useState({ 
    name: '', 
    rating: 5, 
    notes: '',
    chemistryRating: 5,
    attractionRating: 5,
    vibeCheck: 'meh',
    emotionalImpact: 'comfortable',
    conversationQuality: 'flowing',
    effortLevel: 'casual',
    bodyLanguage: 'open',
    greenFlags: [],
    redFlags: [],
    profileImage: null,
    imageAnalysis: null
  });
  const [activeTab, setActiveTab] = useState('home');
  const [user, setUser] = useState(null);
  const [authForm, setAuthForm] = useState({ email: '', password: '', username: '', firstName: '', lastName: '' });
  const [isLogin, setIsLogin] = useState(true);
  const [loading, setLoading] = useState(false);
  const [insights, setInsights] = useState([]);
  const [uploadingImage, setUploadingImage] = useState(false);

  // Check if user is logged in on app start
  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      verifyToken(token);
    }
  }, []);

  const verifyToken = async (token) => {
    try {
      const response = await fetch('http://localhost:5001/api/auth/verify', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${token}`
        }
      });

      if (response.ok) {
        const data = await response.json();
        setUser(data.user);
        // Load user's dates
        loadUserDates();
      } else {
        localStorage.removeItem('token');
      }
    } catch (error) {
      localStorage.removeItem('token');
    }
  };

  const loadUserDates = async () => {
    try {
      const response = await fetch('http://localhost:5001/api/dates', {
        headers: {
          'Authorization': `Bearer ${localStorage.getItem('token')}`
        }
      });

      if (response.ok) {
        const data = await response.json();
        setDates(data.dates);
      }
    } catch (error) {
      console.error('Error loading dates:', error);
    }
  };

  const handleAuth = async (e) => {
    e.preventDefault();
    setLoading(true);

    try {
      const endpoint = isLogin ? '/login' : '/register';
      const response = await fetch(`http://localhost:5001/api/auth${endpoint}`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(authForm)
      });

      if (response.ok) {
        const data = await response.json();
        localStorage.setItem('token', data.token);
        setUser(data.user);
        setAuthForm({ email: '', password: '', username: '', firstName: '', lastName: '' });
        loadUserDates();
      } else {
        const errorData = await response.json();
        alert(errorData.message || 'Authentication failed');
      }
    } catch (error) {
      alert('Error: ' + error.message);
    } finally {
      setLoading(false);
    }
  };

  const logout = () => {
    localStorage.removeItem('token');
    setUser(null);
    setDates([]);
    setActiveTab('home');
  };

  const addDate = () => {
    if (!newDate.name.trim()) {
      alert('Please enter a name');
      return;
    }

    const dateToAdd = {
      ...newDate,
      id: Date.now(),
      date: new Date().toLocaleDateString()
    };

    if (user) {
      // Save to backend
      saveDateToBackend(dateToAdd);
    } else {
      // Save to local state
      setDates([...dates, dateToAdd]);
    }

    setNewDate({ 
      name: '', 
      rating: 5, 
      notes: '',
      chemistryRating: 5,
      attractionRating: 5,
      vibeCheck: 'meh',
      emotionalImpact: 'comfortable',
      conversationQuality: 'flowing',
      effortLevel: 'casual',
      bodyLanguage: 'open',
      greenFlags: [],
      redFlags: [],
      profileImage: null,
      imageAnalysis: null
    });
    setActiveTab('roster');
  };

  const saveDateToBackend = async (dateData) => {
    try {
      const response = await fetch('http://localhost:5001/api/dates', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${localStorage.getItem('token')}`
        },
        body: JSON.stringify(dateData)
      });

      if (response.ok) {
        loadUserDates();
      } else {
        alert('Failed to save date');
      }
    } catch (error) {
      alert('Error saving date: ' + error.message);
    }
  };

  const testAPI = async () => {
    try {
      const response = await fetch('http://localhost:5001/health');
      if (response.ok) {
        alert('âœ… Backend is running!');
      } else {
        alert('âŒ Backend is not responding');
      }
    } catch (error) {
      alert('âŒ Cannot connect to backend: ' + error.message);
    }
  };

  const getInsights = async () => {
    try {
      const response = await fetch('http://localhost:5001/api/ai/insights', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': user ? `Bearer ${localStorage.getItem('token')}` : ''
        }
      });

      if (response.ok) {
        const data = await response.json();
        setInsights(data.insights);
        setActiveTab('insights');
      } else {
        alert('Failed to get insights');
      }
    } catch (error) {
      alert('Error getting insights: ' + error.message);
    }
  };

  const uploadImage = async (file) => {
    setUploadingImage(true);
    try {
      const formData = new FormData();
      formData.append('image', file);

      const response = await fetch('http://localhost:5001/api/upload/profile-image', {
        method: 'POST',
        body: formData
      });

      if (response.ok) {
        const data = await response.json();
        setNewDate({ ...newDate, profileImage: data.imageUrl });

        // Analyze the uploaded image
        const analysisResponse = await fetch('http://localhost:5001/api/ai/analyze-image', {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify({ imageUrl: data.imageUrl })
        });

        if (analysisResponse.ok) {
          const analysisData = await analysisResponse.json();
          setNewDate({ ...newDate, profileImage: data.imageUrl, imageAnalysis: analysisData.analysis });
        }
      } else {
        alert('Failed to upload image');
      }
    } catch (error) {
      alert('Error uploading image: ' + error.message);
    } finally {
      setUploadingImage(false);
    }
  };

  const handleImageChange = (event) => {
    const file = event.target.files[0];
    if (file) {
      uploadImage(file);
    }
  };

  const renderAuth = () => (
    <div className="auth-container">
      <div className="auth-card">
        <h2 className="auth-title">THE ROSTER AI</h2>
        <div className="auth-subtitle">DATING IS A MESS â€¢ SORT IT OUT</div>

        <form onSubmit={handleAuth} className="auth-form">
          {!isLogin && (
            <>
              <input
                type="text"
                placeholder="Username"
                value={authForm.username}
                onChange={(e) => setAuthForm({...authForm, username: e.target.value})}
                className="auth-input"
                required
              />
              <input
                type="text"
                placeholder="First Name"
                value={authForm.firstName}
                onChange={(e) => setAuthForm({...authForm, firstName: e.target.value})}
                className="auth-input"
                required
              />
              <input
                type="text"
                placeholder="Last Name"
                value={authForm.lastName}
                onChange={(e) => setAuthForm({...authForm, lastName: e.target.value})}
                className="auth-input"
                required
              />
            </>
          )}
          <input
            type="email"
            placeholder="Email"
            value={authForm.email}
            onChange={(e) => setAuthForm({...authForm, email: e.target.value})}
            className="auth-input"
            required
          />
          <input
            type="password"
            placeholder="Password"
            value={authForm.password}
            onChange={(e) => setAuthForm({...authForm, password: e.target.value})}
            className="auth-input"
            required
          />
          <button type="submit" className="auth-button" disabled={loading}>
            {loading ? 'Loading...' : (isLogin ? 'LOGIN' : 'REGISTER')}
          </button>
        </form>

        <button 
          onClick={() => setIsLogin(!isLogin)} 
          className="auth-toggle"
        >
          {isLogin ? 'Need an account? Register' : 'Have an account? Login'}
        </button>
      </div>
    </div>
  );

  const renderHome = () => (
    <div className="home-container">
      <div className="home-content">
        <h1 className="home-title">THE ROSTER AI</h1>
        <div className="home-subtitle">DATING IS A MESS â€¢ SORT IT OUT</div>

        <div className="home-features">
          <div className="feature-item">
            <span className="feature-icon">ðŸ’¡</span>
            <span className="feature-text">Get Unique Insight</span>
          </div>
          <div className="feature-item">
            <span className="feature-icon">ðŸ“</span>
            <span className="feature-text">RECORD Your Interactions</span>
          </div>
          <div className="feature-item">
            <span className="feature-icon">ðŸ“±</span>
            <span className="feature-text">SHARE your Roster to the GC</span>
          </div>
          <div className="feature-item">
            <span className="feature-icon">âš–ï¸</span>
            <span className="feature-text">SIDE by SIDE Comparisons</span>
          </div>
        </div>

        <div className="home-actions">
          <button onClick={() => setActiveTab('add-date')} className="action-button primary">
            ADD NEW DATE
          </button>
          <button onClick={() => setActiveTab('roster')} className="action-button secondary">
            VIEW ROSTER
          </button>
          <button onClick={getInsights} className="action-button secondary">
            GET AI INSIGHTS
          </button>
          <button onClick={testAPI} className="action-button secondary">
            TEST API
          </button>
